import React, {FC} from 'react';
import FuelwiseList from 'api/fuelwiseAPI';
import FuelWiseContext from 'contexts/fuelWiseContext';
import Layout from 'components/global/layout';
import './styles.scss';

interface IProps {};

export const FuelWise: FC<IProps> = () => (
  <Layout title="Fuel wise" description="This is the Fuel wise Page">
    <div className="fuel-wise-page">
      <p>
        This is the <strong>Fuel wise</strong> page
      </p>
    </div>
    <FuelWiseContext.Provider>
    <FuelwiseList />
    </FuelWiseContext.Provider>
  </Layout>
);

export default FuelWise;
